package com.sos.project.entity;

public class StyleName {
	
	private Long styleNameId;
	private String name;
	private int order;

	public StyleName() {
		// TODO Auto-generated constructor stub
	}

	public Long getStyleNameId() {
		return styleNameId;
	}

	public void setStyleNameId(Long styleNameId) {
		this.styleNameId = styleNameId;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public int getOrder() {
		return order;
	}

	public void setOrder(int order) {
		this.order = order;
	}

}
